import React from 'react'
import HeroSection from "../pages/HeroSection";
import BodyMid from "../pages/BodyMid";
import Body from "../pages/Body";
import Footer from "../components/Footer";

const InitialLoad = () => {
  return (
<div>
    <HeroSection />
    <BodyMid />
    <Body />
    <Footer />
</div>

  );
}

export default InitialLoad
